// GoogleSQLLexerInit initializes any static state used to implement GoogleSQLLexer. By default the
// static state used to implement the lexer is lazily initialized during the first call to
// NewGoogleSQLLexer(). You can call this function if you wish to initialize the static state ahead
// of time.
func GoogleSQLLexerInit() {
	staticData := &GoogleSQLLexerLexerStaticData
	staticData.once.Do(googlesqllexerLexerInit)
}

// NewGoogleSQLLexer produces a new lexer instance for the optional input antlr.CharStream.
func NewGoogleSQLLexer(input antlr.CharStream) *GoogleSQLLexer {
	GoogleSQLLexerInit()
	l := new(GoogleSQLLexer)
	l.BaseLexer = antlr.NewBaseLexer(input)
	staticData := &GoogleSQLLexerLexerStaticData
	l.Interpreter = antlr.NewLexerATNSimulator(l, staticData.atn, staticData.decisionToDFA, staticData.PredictionContextCache)
	l.channelNames = staticData.ChannelNames
	l.modeNames = staticData.ModeNames
	l.RuleNames = staticData.RuleNames
	l.LiteralNames = staticData.LiteralNames
	l.SymbolicNames = staticData.SymbolicNames
	l.GrammarFileName = "GoogleSQLLexer.g4"
	// TODO: l.EOF = antlr.TokenEOF

	return l
}

